import { supabase } from "./supabaseClient";

const fetchRushroom = async ()=>{
    const{data , error} = await supabase
    .from("toilets")
    .select()

    if(error){
        console.log(`ERROR ::: ${error}`);
    }

    if(data){
        console.log(data);
    }
    return data;
}

export default fetchRushroom
